import React, { Component } from "react";
import { Link } from "react-router-dom";

import { MenuStyle } from "../2_styles/3_module/MenuStyle";
import Line from "../0_components/Line";

export default class Menu extends Component {
  render() {
    return (
      <MenuStyle>
        <div id="menu_box">
          <ul className="link_box menu_link-hide">
            <Link to="/the-initiative">
              <li className="menu_link">The Initiative</li>
            </Link>
            <div className="line menu_line menu_line-top">
              <Line opacity="0.3" width="90vw" />
            </div>
            <Link to="/the-original-six">
              <li className="menu_link">The Original Six</li>
            </Link>
            <div className="line menu_line menu_line-bottom">
              <Line opacity="0.3" width="90vw" />
            </div>
            <Link to="/the-become-an-avenger">
              <li className="menu_link">Become An Avenger</li>
            </Link>
          </ul>
        </div>
      </MenuStyle>
    );
  }
}
